INSERT INTO `pentabilities` (`Id`, `Name`, `Explanation`, `Image`) VALUES
(1, 'Responsabilidad', 'Habilidad de lograr con calidad las tareas asignadas, en el lugar y el momento adecuados, con el objetivo de responder a nuestros compromisos y respetando las normas acordadas.\r\no	Trabaja de forma constante.\r\no	Se mantiene conectado/a a la actividad del grupo.\r\no	Hace comentarios relacionados con la tarea a realizar.\r\no	Realiza las tareas de forma eficiente.\r\no	Realiza las tareas con cuidado.\r\no	Persevera ante las dificultades.\r\no	Respeta las normas.\r\n', );
INSERT INTO `pentabilities` (`Id`, `Name`, `Explanation`, `Image`) VALUES
(2, 'Cooperación', 'Habilidad de interaccionar de forma constructiva y a partir de la escucha, con el objetivo de conseguir una meta común y consensuada.\r\no	Escucha a los demás.\r\no	Incorpora lo que dicen los demás.\r\no	Fomenta la participación de los miembros del grupo.\r\no	Participa en la toma de decisiones consensuadas.\r\no	Ayuda a resolver conflictos.\r\no	Reconoce sus responsabilidades y las de los demás.\r\no	Ayuda a los demás de forma desinteresada.', );
INSERT INTO `pentabilities` (`Id`, `Name`, `Explanation`, `Image`) VALUES
(3, 'Autonomía e iniciativa', 'Habilidad de emprender acciones e implicarse en las actividades, utilizando los recursos propios, y de saber cuándo pedir ayuda.\r\no	Aporta ideas.\r\no	Hace preguntas cuando se encalla.\r\no	Toma decisiones para que el proyecto avance.\r\no	Sabe convencer al grupo de sus propuestas.\r\no	Trabaja con determinación.\r\no	Cree que puede iniciar cambios.', );
INSERT INTO `pentabilities` (`Id`, `Name`, `Explanation`, `Image`) VALUES
(4, 'Gestión emocional', 'Habilidad de percibir y aceptar las emociones propias y las de los demás, con el objetivo de desarrollar estrategias de gestión personal eficaces.\r\no	Transmite alegría.\r\no	Se muestra tranquilo/a en situaciones de presión.\r\no	Controla las emociones en situaciones de conflicto.\r\no	Asume la posibilidad de equivocarse.\r\no	Acepta que los cambios que propone no salgan adelante.\r\no	Adecúa el comportamiento a las circunstancias.', );
INSERT INTO `pentabilities` (`Id`, `Name`, `Explanation`, `Image`) VALUES
(5, 'Habilidades de pensamiento', 'Habilidad de relacionar, cuestionar, generar y exponer ideas.\r\no	Relaciona contenidos nuevos con conocimientos previos.\r\no	Hace buenas reflexiones sobre los contenidos trabajados.\r\no	Hace buenas reflexiones sobre sus procesos personales internos.\r\no	Hace buenas preguntas (para entender o para permitir avanzar).\r\no	Tiene ideas creativas (explora caminos alternativos).\r\no	Plantea buenas estrategias de resolución de problemas.\r\no	Tiene interés en explorar perspectivas diferentes.\r\no	Expresa eficazmente las ideas (corrección, precisión y estructura).', );

